import Cart from "./Cart";

const Navigation = () => {
  return (
    <nav>
      <h1
        style={{
          justifyContent: "space-between",
          color: "Black",
          display: "flex",
          marginLeft: "1px",
        }}
      >
        Pharmacy Menu
        <Cart />
      </h1>
    </nav>
  );
};
export default Navigation;
